ight()+\n","  theme(axis.text.x = element_text(angle = 90)) +\n","  labs(title = \"Average Total Intensity vs. Time\", x= \"Time\", y=\"Mean Total Intensity\")\n"]},{"cell_type":"markdown","id":"b4620f11","metadata":{"papermill":{"duration":0.0236,"end_time":"2023-06-05T15:11:06.436746","exception":false,"start_time":"2023-06-05T15:11:06.413146","status":"completed"},"tags":[]},"source":["* Most participants active between 6am and 10pm\n","* The peak of activity intensity occurs during the late afternoon, from 5pm to 7pm. At that time period, almost people are finishing work and going to the gym or for a walk. We can use **this time (between 5pm to 7pm) in the Bellabeat app to remind and motivate users to get moving**."]},{"cell_type":"markdown","id":"e3837d25","metadata":{"papermill":{"duration":0.022536,"end_time":"2023-06-05T15:11:06.482752","exception":false,"start_time":"2023-06-05T15:11:06.460216","status":"completed"},"tags":[]},"source":["## PHASE 6: Share"]},{"cell_type":"markdown","id":"e995ca98","metadata":{"papermill":{"duration":0.022652,"end_time":"2023-06-05T15:11:06.528325","exception":false,"start_time":"2023-06-05T15:11:06.505673","status":"completed"},"tags":[]},"source":["|Product| Features | Description and recommendation |\n","|---| ---| ---|\n","|1. Bellabeat App| Bellabeat App: Provides health data related activity, sleep, stress, menstrual cycle, and mindfulness habits| The average users of Bellabeat app walk more than 7,600 steps per day. We can encourage them to reach the American Heart Association's recommended daily step goal of 10,000. **I recommend sending friendly reminders if they haven't reached that number of steps and by creating posts on app explaining the benefits of reaching that goal**.\n","|2. Bellabeat Leaf| Tracks activity, heartrate, sleep, and stress| First of all, 24% participants do not wear devices almost all day, even when they are sleeping. **I recommend using Bellabeat Leaf that can be worn as necklaces more than clips and bracelets could help to collect more data about sleep, which could be used to improve sleep quality and overall health.** Second, the intensity of an activity directly affects the number of calories burned. Additionally, the number of steps taken each day is positively correlated with the number of calories burned. Most users burn 2,000 calories per day, which is the daily intake recommendation by the FDA. **I recommend personalized workout help users track and achieve their fitness goals.** \n","|3. Bellabeat Time| Tracks activity, heartrate, sleep, and stress| Users sleep less than 8 hours per day. **I recommend emphasizing healthy sleep patterns and rewarding users for daytime activity, especially from 5pm to 7pm. In addition, Offering helpful resources to help users sleep, such as breathing exercises, podcasts with relaxing music, and sleep techniques.**"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":12.741674,"end_time":"2023-06-05T15:11:06.67305","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-06-05T15:10:53.931376","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}